    sync::Map structSize;
    int dataSize(reflect::Value v)
    {
        //Go switch emulation
        {
            auto condition = Kind(gocpp::recv(v));
            int conditionId = -1;
            if(condition == reflect::Slice) { conditionId = 0; }
            else if(condition == reflect::Struct) { conditionId = 1; }
            switch(conditionId)
            {
                case 0:
                    if(auto s = sizeof(Elem(gocpp::recv(Type(gocpp::recv(v))))); s >= 0)
                    {
                        return s * Len(gocpp::recv(v));
                    }
                    break;
                case 1:
                    auto t = Type(gocpp::recv(v));
                    if(auto [size, ok] = Load(gocpp::recv(structSize), t); ok)
                    {
                        return gocpp::getValue<int>(size);
                    }
                    auto size = sizeof(t);
                    Store(gocpp::recv(structSize), t, size);
                    return size;
                    break;
                default:
                    if(IsValid(gocpp::recv(v)))
                    {
                        return sizeof(Type(gocpp::recv(v)));
                    }
                    break;
            }
        }
        return - 1;
    }

    int sizeof(reflect::Type t)
    {
        //Go switch emulation
        {
            auto condition = Kind(gocpp::recv(t));
            int conditionId = -1;
            if(condition == reflect::Array) { conditionId = 0; }
            else if(condition == reflect::Struct) { conditionId = 1; }
            else if(condition == reflect::Bool) { conditionId = 2; }
            else if(condition == reflect::Uint8) { conditionId = 3; }
            else if(condition == reflect::Uint16) { conditionId = 4; }
            else if(condition == reflect::Uint32) { conditionId = 5; }
            else if(condition == reflect::Uint64) { conditionId = 6; }
            else if(condition == reflect::Int8) { conditionId = 7; }
            else if(condition == reflect::Int16) { conditionId = 8; }
            else if(condition == reflect::Int32) { conditionId = 9; }
            else if(condition == reflect::Int64) { conditionId = 10; }
            else if(condition == reflect::Float32) { conditionId = 11; }
            else if(condition == reflect::Float64) { conditionId = 12; }
            else if(condition == reflect::Complex64) { conditionId = 13; }
            else if(condition == reflect::Complex128) { conditionId = 14; }
            switch(conditionId)
            {
                case 0:
                    if(auto s = sizeof(Elem(gocpp::recv(t))); s >= 0)
                    {
                        return s * Len(gocpp::recv(t));
                    }
                    break;
                case 1:
                    auto sum = 0;
                    for(auto [i, n] = std::tuple{0, NumField(gocpp::recv(t))}; i < n; i++)
                    {
                        auto s = sizeof(Field(gocpp::recv(t), i).Type);
                        if(s < 0)
                        {
                            return - 1;
                        }
                        sum += s;
                    }
                    return sum;
                    break;
                case 2:
                case 3:
                case 4:
                case 5:
                case 6:
                case 7:
                case 8:
                case 9:
                case 10:
                case 11:
                case 12:
                case 13:
                case 14:
                    return int(Size(gocpp::recv(t)));
                    break;
            }
        }
        return - 1;
    }

    
