    void skip(struct decoder* d, reflect::Value v)
    {
        d->offset += dataSize(v);
    }

    void skip(struct encoder* e, reflect::Value v)
    {
        auto n = dataSize(v);
        auto zero = e->buf.make_slice(e->offset, e->offset + n);
        for(auto [i, gocpp_ignored] : zero)
        {
            zero[i] = 0;
        }
        e->offset += n;
    }

